// Model ID mappings for V&V API
// These mappings were discovered by testing the V&V API
export const modelIdMappings = {
    // Maytag washers - all use ID 87048
    'MAV6000AWQ': '87048',
    'MAV6000AWW': '87048',
    'MAV6000AWB': '87048',
    'MAV6000AGW': '87048',
    'MAV7000AWW': '87048',
    'MAV7000AWQ': '87048',
    'MAV8000AWW': '87048',
    'MAV5000AWW': '87048',
    'MAV5000AWQ': '87048',
    'MAV4000AWW': '87048',

    // Whirlpool models - all use ID 10001
    'WTW5000DW': '10001',
    'WTW4816FW': '10001',
    'WRF555SDFZ': '10001'
};

// Helper function to get model ID
export const getModelId = (modelNumber) => {
    return modelIdMappings[modelNumber] || null;
};

// Initialize model ID mappings (for backward compatibility)
export const initializeModelIdMappings = () => {
    const count = Object.keys(modelIdMappings).length;
    console.log(`✅ Initialized ${count} model ID mappings`);
    return count;
};
